import "../assets/css/card.css";

function Card({ image, title, body, demoLink, sourceLink, wide }) {
  let classes = "card";
  if (wide) {
    classes = "card wide";
  }

  return (
    <div className={classes}>
      <img src={image} alt />
      <div className="cardTitle">{title}</div>
      <div className="cardBody">{body}</div>
    </div>
  );
}

export default Card;
